import React from 'react';
import '../css/home.css'; // Fixed path to home.css

function Home() {
  return (
    <div className="home">
      <video className="home-video" src="/assets/videos/bgvid.mp4" autoPlay loop muted />
      <div className="home-content">
        <h1>Welcome to Travel Tribe</h1>
        <p>Plan your next trip with us.</p>
      </div>
    </div>
  );
}

export default Home;
